import React from 'react';

export const MailConfirmPageConfig = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/mail-confirm',
            component: React.lazy(() => import('./MailConfirmPage'))
        }
    ]
};
